import React, { Component } from 'react';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';

export class MyProps extends Component {
    render(props) {
        return (
            <div className= "bg-warning">
                <h2 className= "mt-2">I Have A Pen Thats Company name is- {this.props.peninfo.company} </h2>
                <h2 className= "mt-2">I Have A Pen Thats color is- {this.props.peninfo.color} </h2>
                <h2 className= "mt-2">I Have A Pen Price is- {this.props.peninfo.price} </h2>
            </div>
        )
    }
}

export default MyProps;
